import React from 'react';
import SideNavbar from '../Components/SideNavbar';

const Dashboard = () => {
  const transactionData = [
    { category: 'Pemasukan', totalAmount: 1500000 },
    { category: 'Pengeluaran', totalAmount: 750000 },
    { category: 'Investasi', totalAmount: 300000 },
    { category: 'Hiburan', totalAmount: 500000 },
    { category: 'Tagihan', totalAmount: 200000 },
  ];
  return (
    <div class='text-center'>
      <div class='row'>
        <SideNavbar />
        {/* ini buat dashboard */}
        <div class='col-10'>
        <div className="row">
        {transactionData.map((data, index) => (
          <div className="col-md-4 col-sm-6 mb-4" key={index}>
            <div className="card text-center">
              <div className="card-body">
                <h5 className="card-title">{data.category}</h5>
                <p className="card-text">
                  <strong>Total Transaksi:</strong> Rp {data.totalAmount.toLocaleString()}
                </p>
              </div>
            </div>
          </div>
        ))}
      </div>

        </div>
      </div>
    </div>
  );
};

export default Dashboard;
